import React from "react";
import GeoCoordinate from "./GeoCoordinate";

const HistoryContainer = (props) => {

    const employeeElement = props.coordinates.map(e => <GeoCoordinate coordinate={e} id={e.id} removeItem={removeItem}
                                                               key={e.id}/>)

    return (
        <div>
            {employeeElement}
        </div>
    )
}


export default connect(mapStateToProps, {requestEmployees, removeItem})(HistoryContainer)
